"      Batista J Jr, de Camargo ZP, Fernandes GF, et al. Is the geographical origin of a Paracoccidioides brasiliensis isolate important for antigen production for regional diagnosis of paracoccidioidomycosis? Mycoses 2010; 53:176.",
"     </a>",
"    </li>",
