"      Bellissimo-Rodrigues F, Machado AA, Martinez R. Paracoccidioidomycosis epidemiological features of a 1,000-cases series from a hyperendemic area on the southeast of Brazil. Am J Trop Med Hyg 2011; 85:546.",
"     </a>",
